11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Universalmente conocido como uno de los magos más grandes de la época. Dotado de genio fértil, benevolencia, amabilidad y perspicacia. De todos los disfraces, generalmente se transformaba en conejo, muy pocos han visto su verdadero rostro detrás de la magia."],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"El legendario contador de historias y compositor de la tribu. Mientras deambulaba por las tierras y los mares, nunca nadie lo vio. Con su voz profunda y su ingenio se han cantado muchos elogios. "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Puro y sexy. Llena de curiosidad por el mundo exterior, siempre que se siente expresiva le encanta tocar la batería."],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"Es el Rey de todos los leones, y camina como un humano. Perdió en el pasado su maravillosa tierra natal junto con sus miembros tribales, pero con su fuerza, testimonio y valentía excepcionales, un verdadero líder la recuperará por fin."],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
