12681=>["Value"=>12681,"TextKey"=>"新手引导说明1012","TextValue"=>"<line-height=130%><color=#38aec0>¡La Tierra Natal</color> está desbloqueada! ¡Échale un vistazo!"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>¡Persona de buen corazón, ayúdame por favor!"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>¡Estoy atrapado en estos <color=#38c0a5>Tótems</color>!"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"Arrastra 3 <color=#38c0a5>Tótems</color> del mismo tipo para activar una <color=#f58c26>Combinación</color>, y la maldición se levantará."],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%>¡Ah! ¡No veo ningún tótem aquí!"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>¡Mira! Ese es el <color=#f58c26>Código de la Creación</color>. Lo verás en varios niveles. Veamos qué hay escrito dentro."],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>Tócalo para obtener algunos consejos útiles para el juego. ¡Pruébalo!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>Si quieres superar un nivel, necesitas obtener un <color=#f58c26>Objeto Designado</color>."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%>El <color=#f58c26>Objetivo de nivel</color> te dirá lo que tienes que obtener. ¡Comienza a combinar y gana!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>¡Wow, un <color=#ef933d>Tallado de la Joven Embla</color>! ¡Sus poderes también se han desvanecido! Tenemos que despertar a <color=#f58c26>Embla</color> combinando los tallados."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Si un nivel tiene estos tallados, normalmente puedes superar el nivel combinándolos."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>Estas tierras han perdido su conexión con la Diosa, por lo que cayeron en un sueño profundo."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>No puedes mover ningún objeto en <color=#38aec0>Tierras Durmientes</color>."],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Combina <color=#38c0a5>Flores Espirituales</color> para despertar la tierra."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>¡Cuando ganes, la <color=#f58c26>Diosa Embla</color> despertará todas las tierras!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>¡Mira! Es un <color=#38c0a5>Tótem</color>."],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"¡Date prisa y combina <color=#38c0a5>Tres Tótems</color> para salvar al miembro de la tribu atrapado dentro!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Como acabamos de decir, puedes tocar un <color=#38c0a5>Orbe Rúnico Salvaje</color> para despertar la tierra."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>¡Por supuesto, también puedes combinarlos para obtener orbes más avanzados!"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"Puedes combinar objetos en <color=#38aec0>Tierras Durmientes</color> con los que están en tierras normales para despertar a los durmientes automáticamente."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"Toca un <color=#38c0a5>Grupo de Tótems</color> para obtener un <color=#38c0a5>Tótem</color>."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Algunas <color=#38aec0>Tierras Súper Durmientes</color> no pueden ser despertadas mediante <color=#f58c26>Puntos de Curación</color>, solo se pueden despertar combinando sus objetos con los de tierras normales."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>A partir de ahora, los niveles vienen con <color=#f58c26>Tareas</color>."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>Puedes consultar el <color=#38c0a5>Sol de Tareas</color> para ver las tareas y las recompensas."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Este botón puede bloquear o desbloquear la <color=#f58c26>Función de Arrastre de Pantalla</color>."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Algunos objetos no se pueden combinar directamente. Toca el <color=#ef933d>Montón de Rocas en Forma de Cuña</color> para dividirlo en <color=#ef933d>Rocas en Forma de Cuña</color>y luego combina. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>Tienes que consultar los <color=#f58c26>Objetivos de Nivel</color>."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>Podemos obtener <color=#ef933d>Brotes de Arbusto</color> de <color=#38c0a5>Huesos de Dragón</color>."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Esta es una enorme <color=#ef933d>Bomba Despertadora</color>. Si despiertas la tierra a su lado, se despertará automáticamente y despertará las baldosas que la rodean directamente."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"Los miembros tribales pueden recoger <color=#38c0a5>Minerales Salvajes</color> para ti de las <color=#38c0a5>Vides</color> de nivel alto."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Esta es una <color=#ef933d>Tumba Destrozada</color>. Si la descuidas o la combinas, se convertirá en terroríficos <color=#df66a8>Zombis</color>. Derrótalos para obtener <color=#38c0a5>Luciérnagas</color>, que necesitas para superar el nivel."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"Un <color=#ef933d>Nido de Pared Abandonado</color> genera zombis constantemente incluso cuando está dormido. ¡Al tocarlo se genera un Zombi inmediatamente! Destruir Zombis te da <color=#38c0a5>Minerales Salvajes</color>."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Esto es un <color=#38c0a5>Portal de Runas del Druida</color>, ¡qué suerte tenemos! Combínalos para invocar a un <color=#38c0a5>Miembro Tribal</color> de la Tierra Natal para ayudarte."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"La remanencia del Árbol Sagrado de la Creación. Produce automáticamente <color=#38c0a5>Orbes Rúnicos Salvajes</color>. Cuanto más alto sea el nivel, más fuerte será el poder curativo."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" Las<color=#ef933d>Nubes</color> seguirán apareciendo desde aquí. Tócalas para hacer que llueva. <color=#38c0a5>Charcos</color> y <color=#38c0a5>Flores Espirituales</color> aparecerán en tierras vacías debajo de ellas."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>Qué extraño… ¿dónde están los <color=#ef933d>Tallados de la Joven Embla</color>?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>¡Ah, sí, si completas tus <color=#f58c26>Tareas</color>, aparecerán!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Esta es una <color=#ef933d>Estatua del Demonio</color>. ¡Una obra horrible! Ordena a tu gente que la anule para obtener un <color=#ef933d>Tallado de la Joven Embla</color>."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>¡Se ha abierto un nuevo campamento! ¡Ve a verlo en el Mapa Mundial!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>¡Soy libre de nuevo! ¡Muchas gracias! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>La gente de nuestra tribu está atrapada en estos <color=#38c0a5>Tótems</color>."],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>La tribu necesita tu ayuda para encontrar otros miembros tribales aquí, así como en casa."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>¡Ve a buscarlos en el siguiente nivel!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"Puedes <color=#f58c26>tocar dos veces</color> algunos objetos para llamar a alguien a cosecharlos."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>Puedes usar o combinar los objetos que has reunido."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>Cosecha de una <color=#38c0a5>Flor Espiritual</color> para obtener un <color=#38c0a5>Orbe Rúnico Salvaje</color>."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Toca en el orbe</color> para despertar <color=#38aec0>Tierras Durmientes</color>."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>A partir de ahora, puedes elegir recompensas al final de cada nivel."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Las recompensas son normalmente <color=#38c0a5>Oro</color> u otros recursos útiles. ¡A veces incluso un tótem!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Tus recompensas se pondrán en <color=#f58c26>Burbujas</color> y se enviarán de regreso a casa."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Esta es nuestra <color=#f58c26>Tierra Natal</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Nuestra tribu solía vivir aquí, antes de que la <color=#f58c26>Gran Inundación</color> destruyera nuestra pacífica vida, dejando una densa niebla cubriendo la tierra."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>¡Combina objetos con otros en tierras inactivas para despertar la tierra directamente! ¡Intenta combinar para rescatar a más miembros de la tribu! Cuanto mayor sea tu población, más niebla podrás despejar y más rápido podrás reconstruir nuestra casa."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Solo puedes desbloquear un <color=#38c0a5>Cofre del Tesoro del Tiempo</color> a la vez. Espera al final de la cuenta atrás para obtenerlos, o gasta rubíes para obtener cualquier <color=#38c0a5>Cofre del Tesoro del Tiempo</color> inmediatamente."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>¡Han llegado las recompensas de nivel! ¡Abre las burbujas y échales un vistazo!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>Barracones</color> son lugares donde los trabajadores pueden descansar. Saldrán después de cierto tiempo."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"Los <line-height=130%><color=#38c0a5>Barracones</color> se pueden combinar en otros de nivel superior. Cuanto más alto es el nivel, más corto es el tiempo que tardan los miembros de la tribu en descansar dentro."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Gasta <color=#38c0a5>Rubíes</color> para despertarlos inmediatamente."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"Puedes completar más tareas en la Tierra Natal para obtener más <color=#38c0a5>Herencia Olvidada</color>. ¡Tócalas para obtener recompensas especiales!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Esta es una pequeña <color=#38c0a5>Moneda de Oro</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Puedes tocarlas para obtener <color=#38c0a5>Oro</color>, o puedes combinarlas para obtener pepitas de oro más avanzadas."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>Puedes gastar tu <color=#38c0a5>Oro</color> en la <color=#f58c26>Tienda</color>."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>¿Demasiado oro? ¡Puedes ir a comprar cosas realmente buenas en la tienda!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Todos los <color=#df66a8>Miembros Tribales</color> están muy cansados. Necesitan un descanso para recuperar su energía."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>¡Es hora de superar más niveles y salvar a más personas!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Cuantos más miembros de la tribu tengas, más recursos podrán reunir para ti antes de irse a dormir."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Supera niveles para rescatar más miembros tribales."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>¡Y tráelos de vuelta a casa!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>¡Mira! Puedes ir al campamento tocando el <color=#f58c26>Mapa del Mundo</color>."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>Ya no hay espacio para poner nada: ¡el suelo está completamente cubierto!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Selecciona un objeto y toca en el cuadro de información para venderlo o descartarlo. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Esto es una <color=#38c0a5>Herencia Alienígena</color>, ¡es extremadamente rara! ¡Tócala para recibir <color=#38c0a5>Rubíes</color>! ¡O puedes combinarlos en otros más avanzados!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Esto es un <color=#38c0a5>Mineral Salvaje</color>."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>Puedes tocarlos para recoger<color=#38c0a5>Minerales Salvajes</color>, ¡o puedes combinarlos para obtener minerales más avanzados!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>Puedes gastar los <color=#38c0a5>Minerales Salvajes</color> que has recogido en la <color=#f58c26>Tienda</color>."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>Si tu almacenamiento de <color=#38c0a5>Mineral Salvaje</color> está demasiado lleno, también puedes gastarlos en la tienda."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"¡Esta <color=#38c0a5>Barricada</color> aquí me molesta mucho! Pero no puedes moverla directamente. Puedes ordenar a tus <color=#df66a8>Miembros Tribales</color> que la ataquen para dividirla en barricadas más pequeñas."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"Las<color=#38c0a5>Barbetas</color> contaminan las tierras incluso cuando se encuentran en tierras durmientes. La <color=#f58c26>Barra de Progreso</color> muestra cuánto tiempo transcurre entre cada disparo. Solo puedes atacar a una barbeta despierta."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Esto es un <color=#f58c26>Altar del Héroe</color>. Los héroes cambiarán entre el <color=#f58c26>Modo Inactivo</color> y el <color=#f58c26>Modo de Patrulla</color>."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"¡Con un héroe alrededor, habrá sorpresas adicionales por cualquier <color=#f58c26>combinación de 4 objetos</color>!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"Si están inactivos, puedes gastar <color=#38c0a5>Rubíes</color> para despertarlos inmediatamente."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Puedes hacer clic aquí para ver información sobre el héroe."],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Los héroes tienen habilidades únicas como unidades fuertes de la tribu."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Puedes consultar las descripciones de las habilidades de un héroe aquí en el <color=#f58c26>Cuadro de Habilidades del Héroe</color>."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Puedes subir de nivel a los héroes enviando <color=#f58c26>Misiones</color> terminadas."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"¡Termina todas las misiones para subir de nivel a tu héroe!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>¡Buen trabajo! ¡Más miembros de la tribu se liberaron del sello del hechicero!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"¡Con más miembros en tu tribu, puedes despejar más <color=#f58c26>Niebla</color>!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>La niebla en cada área requiere cierto Poder Tribal para despejarse."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>¡Ahora podemos despejar la niebla en esta área!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"No puedes despejar esta niebla aún."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>Tu <color=#f58c26>Poder Tribal</color> no es lo suficientemente alto. Puedes comprar más tótems en la tienda."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>¡Gasta oro para comprar tótems!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>El precio de los tótems aumentará después de cada compra. ¡Ve a conseguir más oro!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>Este nivel tiene un <color=#f58c26>Límite de Tiempo</color>. Debes completar la prueba en el tiempo límite indicado, o perderás."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>Puedes comprobar cuánto tiempo queda aquí."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>A medida que se reduce el tiempo restante, el color de los números cambiará de <color=#46bb83>Verde</color> a <color=#eca852>Amarillo</color> y finalmente a <color=#e04030>Rojo</color>."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>Para superar el nivel más rápido, puedes visitar la Tienda."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>Puedes gastar <color=#38c0a5>Rubíes</color> para comprar objetos clave en la tienda directamente."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>Este tipo de niveles te otorga un <color=#38c0a5>Miembro Tribal</color> como recompensa. Puedes gastar <color=#38c0a5>Rubíes</color> para duplicar tus recompensas."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>¡Bienvenido a otra Prueba de Dios! También recibirás una recompensa después de superar el desafío."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Puedes completar una prueba <color=#f58c26>tres veces</color>, pero el límite de tiempo se acortará cada vez."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Tendrás que esperar a la sesión de entrenamiento del héroe para subir de nivel, o puedes gastar <color=#38c0a5>Rubíes</color> para acelerar el proceso."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Mira, esto es un <color=#46bb83>Nicho de Mosaico</color>, controla una gran área de niebla."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Arrastra el objeto correspondiente al nicho para despejar la niebla."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Si el nicho aún sigue dormido, entonces tendrás que despertarlo primero."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>¡Bienvenido al Evento! Este solo será accesible por un tiempo limitado."],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>¡Participar en un evento te da montones de recompensas que serán enviadas a tu Tierra Natal!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>¡Las antorchas son necesarias para que te adentres en los niveles! Estas se rellenan con el tiempo."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>¡Tienes montones de antorchas ahora! ¡Úsalas para jugar en niveles!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>¡A partir de ahora, puedes comprobar tus <color=#38c0a5>Recompensas de Campamento</color>!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>¡Cuando sea el momento, podrás reclamar tus recompensas!"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>¡Cuantas más estrellas consigas en los niveles, más recompensas obtendrás!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>¡Mirar! ¡Está justo ahí en el mapa! ¡Desbloquéalo y compruébalo!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Nuestro explorador encontró un nuevo lugar ideal para un nuevo campamento, ¡échale un vistazo!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>¡Podríamos conocer a alguien realmente interesante por aquí!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Bienvenido al <color=#46bb83>Evento de Escapada Invernal</color>, ¡un mundo maravilloso te espera!"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%>Bienvenido al <color=#46bb83>Evento de la Ciudad de Cuento de Hadas</color>, ¡un mundo maravilloso te espera!"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12804=>["Value"=>12804,"TextKey"=>"新手引导说明2340","TextValue"=>"<line-height=130%>Bienvenido al <color=#46bb83>Evento de Mundo Submarino</color>, ¡un mundo maravilloso te espera!"],
12805=>["Value"=>12805,"TextKey"=>"新手引导说明2341","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12806=>["Value"=>12806,"TextKey"=>"新手引导说明2342","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12807=>["Value"=>12807,"TextKey"=>"新手引导说明2350","TextValue"=>"<line-height=130%>Esto es un <color=#46bb83>Objeto Especial de Evento</color> disponible durante los eventos. ¡Tócalo para obtener jugosos <color=#46bb83>Puntos de Evento</color>!"],
12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>Esta página te muestra todas las recompensas que puedes obtener al acumular puntos en el Evento. Una vez que tengas suficientes puntos, la <color=#46bb83>Recompensa de Puntos de Evento</color> correspondiente será enviada a tu <color=#f58c26>Tierra Natal</color>."],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"¡Cuantos más puntos acumules, más recompensas obtendrás! ¡Diviértete!"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>"Las<line-height=130%><color=#f58c26>Tareas diarias</color> están disponibles, ¡échales un vistazo!"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>Hay múltiples <color=#f58c26>Tareas Diarias</color> para ti todos los días. Serás recompensado cada vez que completes una de ellas."],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%>¡Si completas todas las <color=#f58c26>Tareas diarias</color>, obtendrás un <color=#f58c26>Premio Extra</color>! "],
12813=>["Value"=>12813,"TextKey"=>"新手引导说明2420","TextValue"=>"<line-height=130%>Hola, soy Miau-Miau, ¡bienvenido al Reino <color=#46bb83>Miau Miau</color>! ¡Mi maravilloso Reino te espera!"],
12814=>["Value"=>12814,"TextKey"=>"新手引导说明2421","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12815=>["Value"=>12815,"TextKey"=>"新手引导说明2422","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas (¡como yo!) y nuevas formas de juego!"],
12816=>["Value"=>12816,"TextKey"=>"新手引导说明2430","TextValue"=>"¿Dónde estamos? ¡No puedo creer que estemos en el antiguo Egipto, donde <color=#46bb83>El Secreto del Faraón</color> está esperando a que lo reveles!"],
12817=>["Value"=>12817,"TextKey"=>"新手引导说明2431","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12818=>["Value"=>12818,"TextKey"=>"新手引导说明2432","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12819=>["Value"=>12819,"TextKey"=>"新手引导说明2460","TextValue"=>"¡Qué hay, socio! ¡Bienvenido al <color=#46bb83>Salvaje Oeste</color>!"],
12820=>["Value"=>12820,"TextKey"=>"新手引导说明2461","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12821=>["Value"=>12821,"TextKey"=>"新手引导说明2462","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12822=>["Value"=>12822,"TextKey"=>"新手引导说明2470","TextValue"=>"El clima es genial. ¡Vamos a hacer <color=#46bb83>el Pícnic Perfecto</color>!"],
12823=>["Value"=>12823,"TextKey"=>"新手引导说明2471","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12824=>["Value"=>12824,"TextKey"=>"新手引导说明2472","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12825=>["Value"=>12825,"TextKey"=>"新手引导说明2500","TextValue"=>"<line-height=130%>Esto es un <color=#46bb83>Objeto de Puntos de Evento</color> disponible durante los eventos. ¡Tócalo para obtener jugosos <color=#46bb83>Puntos de Evento</color>!"],
12826=>["Value"=>12826,"TextKey"=>"新手引导说明2502","TextValue"=>"<line-height=130%>Esta página te muestra todas las recompensas que puedes obtener al acumular puntos en el Evento. Una vez que tengas suficientes puntos, la <color=#46bb83>Recompensa de Puntos de Evento</color> correspondiente será enviada a tu <color=#f58c26>Tierra Natal</color>."],
12827=>["Value"=>12827,"TextKey"=>"新手引导说明2503","TextValue"=>"¡Cuantos más puntos acumules, más recompensas obtendrás! ¡Diviértete!"],
12828=>["Value"=>12828,"TextKey"=>"新手引导说明2510","TextValue"=>"¡Ven a hacer realidad tu sueño infantil en el <color=#46bb83>Paraíso de los Juguetes</color>!"],
12829=>["Value"=>12829,"TextKey"=>"新手引导说明2511","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12830=>["Value"=>12830,"TextKey"=>"新手引导说明2512","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12831=>["Value"=>12831,"TextKey"=>"新手引导说明2520","TextValue"=>"<line-height=130%>Esto es un <color=#46bb83>Objeto de Puntos de Evento</color> disponible durante los eventos. ¡Tócalo para obtener jugosos <color=#46bb83>Puntos de Evento</color>!"],
12832=>["Value"=>12832,"TextKey"=>"新手引导说明2522","TextValue"=>"<line-height=130%>Esta página te muestra todas las recompensas que puedes obtener al acumular puntos en el Evento. Una vez que tengas suficientes puntos, la <color=#46bb83>Recompensa de Puntos de Evento</color> correspondiente será enviada a tu <color=#f58c26>Tierra Natal</color>."],
12833=>["Value"=>12833,"TextKey"=>"新手引导说明2523","TextValue"=>"¡Cuantos más puntos acumules, más recompensas obtendrás! ¡Diviértete!"],
12834=>["Value"=>12834,"TextKey"=>"新手引导说明2530","TextValue"=>"¡El verano es lo mejor! ¡Ven a divertirte en la <color=#46bb83>Playa de Vacaciones</color>!"],
12835=>["Value"=>12835,"TextKey"=>"新手引导说明2531","TextValue"=>"<line-height=130%>¡Participar en un <color=#46bb83>Evento</color> como este te ofrece montones de recompensas, y estas serán enviadas a tu <color=#f58c26>Tierra Natal</color>!"],
12836=>["Value"=>12836,"TextKey"=>"新手引导说明2532","TextValue"=>"<line-height=130%>¡Aquí verás algunos objetos únicos, nuevas criaturas y nuevas formas de juego!"],
12837=>["Value"=>12837,"TextKey"=>"新手引导说明2534","TextValue"=>"Arrastra el <color=#df66a8>Trabajador Rápido</color> sobre construcciones o objetos para la construcción. Puede completar trabajos en un abrir y cerrar de ojos, o reducir el tiempo de una construcción larga en 1 hora."],
12838=>["Value"=>12838,"TextKey"=>"新手引导说明2540","TextValue"=>"Bienvenido a la <color=#f58c26>Casa de los Héroes</color>. Aquí se esconden muchos héroes e historias fascinantes, ¡descúbrelo todo!"],
12839=>["Value"=>12839,"TextKey"=>"新手引导说明2541","TextValue"=>"Combina arrastrando una <color=#ef933d>Bata de Princesa</color> sobre las otras dos, ayudándonos a liberar a la <color=#df66a8>Princesa de la Tribu</color> de la niebla maligna."],
12840=>["Value"=>12840,"TextKey"=>"新手引导说明2542","TextValue"=>"¡Fantástico! Has liberado al primer Héroe... <color=#df66a8>Princesa de la Tribu</color>!  <color=#df66a8>La Princesa de la Tribu</color> te ha traído una orden exquisita. ¡Pulsa y compruébalo!"],
12841=>["Value"=>12841,"TextKey"=>"新手引导说明2543","TextValue"=>"¡Felicidades! Has desbloqueado <color=#ef933d>Trigo</color>, un ingrediente clave para completar los pedidos. ¡Pulsa el <color=#ef933d>Trigo</color> para recogerlo!"],
12842=>["Value"=>12842,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5>Los Libros de Hechizos</color> pueden ayudarte a despejar la niebla y liberar a más Héroes. Puedes conseguir los <color=#38c0a5>Libros de Hechizos</color> completando pedidos."],
12843=>["Value"=>12843,"TextKey"=>"新手引导说明2631","TextValue"=>"My Kingdom and my people are lost in the fog! Can you please <color=#ef933d>Merge</color> three Imperial Crowns to help me?"],
12844=>["Value"=>12844,"TextKey"=>"新手引导说明2633","TextValue"=>"Hey! I am the Old King Hill! It seems like you are the one who woke me up!"],
12845=>["Value"=>12845,"TextKey"=>"新手引导说明2636","TextValue"=>"<color=#ef933d>Merge 3 items</color> of the <color=#ef933d>Same Kind</color> together to clear fog and unlock <color=#ef933d>New heroes</color> and other fun things."],
12846=>["Value"=>12846,"TextKey"=>"新手引导说明2637","TextValue"=>"Drag this plant onto the other two. It will be leveled up to a <color=#ef933d>New Plant</color>. Give it a try!"],
12847=>["Value"=>12847,"TextKey"=>"新手引导说明2639","TextValue"=>"Good job! Keep merging by dragging this plant onto the others. You will get an upgraded <color=#ef933d>New Plant</color>."],
12848=>["Value"=>12848,"TextKey"=>"新手引导说明2641","TextValue"=>"Keep merging the plants. You will get a <color=#ef933d>New Plant</color> of the next level."],
12849=>["Value"=>12849,"TextKey"=>"新手引导说明2643","TextValue"=>"Repeat this move and see what is the <color=#ef933d>New Plant</color> looks like."],
12850=>["Value"=>12850,"TextKey"=>"新手引导说明2645","TextValue"=>"Last step! Drag the plant you just got onto the other two same ones and you'll get a <color=#ef933d>New Plant</color> ready for harvest! "],
12851=>["Value"=>12851,"TextKey"=>"新手引导说明2649","TextValue"=>"Ahh! It's bread! It smells soo good! Let me have a taste!"],
12852=>["Value"=>12852,"TextKey"=>"新手引导说明2652","TextValue"=>"Use the spellbook now to see what's gonna happen!"],
12853=>["Value"=>12853,"TextKey"=>"新手引导说明2663","TextValue"=>"Let's try merge 5 things together and see what's gonna happen！"],
12854=>["Value"=>12854,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
12855=>["Value"=>12855,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
12856=>["Value"=>12856,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crytal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
12857=>["Value"=>12857,"TextKey"=>"新手引导说明2675","TextValue"=>"Remember the <color=#ef933d>Advanced Magic Crytal</color> can be played as a wild card!"],
12858=>["Value"=>12858,"TextKey"=>"新手引导说明2676","TextValue"=>"Use <color=#ef933d>Speedy Workers</color> to complete construction immediately!"],
12859=>["Value"=>12859,"TextKey"=>"新手引导说明2678","TextValue"=>"<color=#ef933d>Speedy Workers</color> have ultra-high efficiency. <color=#ef933d>Drag</color> one onto a building to be constructed to see what's gonna happen!"],
12860=>["Value"=>12860,"TextKey"=>"新手引导说明2686","TextValue"=>"Complete each <color=#ef933d>Task</color> will gain you <color=#ef933d>Experience Points</color> which will upgrade your levels in the game. Tap on the Task button to learn more about it."],
12861=>["Value"=>12861,"TextKey"=>"新手引导说明2688","TextValue"=>"Do you need more <color=#ef933d>Construction Materials</color>，<color=#ef933d>Chests</color> or <color=#ef933d>Other Items</color> for help？Now the Store is open and go check what's on the shelves! There is a <color=#ef933d>Free Chest</color> for you to collect."],
