13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>¡Qué hay, jefe! ¡Soy Tristan, tu explorador! Me alegro de que todos hayamos sobrevivido a ese viaje lleno de baches. Finalmente hemos llegado a tierra firme, así que establezcamos un<color=#f58c26>Campamento</color>. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>¡Esto es bastante exuberante! ¿Qué podríamos encontrarnos por aquí? ¡Comencemos armando nuestra tienda de campaña para protegernos!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Oh querido señor, mira esta inmundicia... ¡y esta fea tienda de campaña! Echo mucho de menos mi hogar..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Mira, Enda, sé que es difícil salir de casa, pero no había otra forma. Todos estos extraños desastres... ¡tenemos que encontrar una respuesta! Por eso pensamos en pedir ayuda."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> Pero encontraremos un camino de regreso, ¿de acuerdo? Empecemos por construir un <color=#f58c26>Altar</color> para que le hables a Dios, ¿qué te parece, sacerdotisa Enda? ¡El jefe ayudará!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>¡Mira lo que hemos encontrado! ¡<color=#ef933d>Herencia Salvaje</color>! ¡Eso es todo lo que necesitamos para el <color=#f58c26>Altar</color>, y hemos encontrado una forma de liberarnos de esos tótems! ¡Este lugar está bendecido!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Supongo que no eres completamente inútil, Stan. Aunque es mucho más pequeño y decepcionante de lo que tenía en casa, ¡será suficiente para mí por ahora! ¡Ahora vete!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Ohhh, qué dulce, ¡mira lo feliz que está y su forma retorcida de decir gracias!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (termina un baile extraño) Nuestro dios me ha dicho que estamos en el lugar correcto y una gran figura vendrá a ayudarnos..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>¿En serio? ¡Esas son buenas noticias! ¿Cuándo conoceremos a esa gran figura?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%> ¿¡Sois vosotros los bandidos que han perturbado mi sueño?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>…...¿Y tú eres?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>¡Soy el Archidruida, padre de los bardos, conquistador de la tormenta, protector de los aventureros, aterrador mensajero de Dios, ejecutor y juez, el Amergin que canta! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Ah...... Encantado de conocerte, ¿supongo? Somos nuevos en el área y acabamos de escuchar..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>¡¿Qué?! ¡¿Sois invasores?! ¡No tendrás oportunidad de destruir nuestro hogar y separar a las familias! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"¿Qué? ¡No, no! No somos invasores, solo estamos tratando de encontrar un lugar para descansar, y quizás resolver el misterio de nuestra tierra natal…"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"¡No! ¡El puente! ¡Mira lo que has hecho! ¡Dios se enfadará! Espera... ¿Quién dijiste que eras? ¿Amergin? ¿Amergin el Archidruida? ¡¿De las leyendas?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"¿Vosotros...... no sois invasores? ¿Quién eres tú? ¿Por qué estás aquí? Espera... ¿Por qué estoy aquí y qué es este lugar? ¿Dónde está mi gente? No recuerdo esta tierra..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Lo siento mucho, pero tampoco tenemos las respuestas. Viajamos lejos, arriesgamos nuestras vidas para llegar hasta aquí, tratando de encontrar ayudantes que puedan resolver el misterio de nuestra tierra natal. Primero una densa niebla cayó sobre nosotros, luego..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"Hemos tenido más inundaciones el año pasado que la última década. Sin embargo, lo más curioso es que la gente se ha convertido en tótems sin vida. ¡¿Puedes creerlo?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"Oh... eso es... mucho para asimilar. Siento haberte atacado y destruido tu puente. ¿Quizás pueda ayudar a reconstruirlo?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"¡¿Amergin?! ¡¿El poderoso Amergin?! Tu túnica, tu poder para dominar la tormenta... ¡Eres real! ¡Eso significa que esos cuentos en el libro de mi familia son reales!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>¡Trabajadores! ¡Reuníos y reconstruid ese puente!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>¡Pero estamos heridos! ¡No podemos empezar a construir ahora! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"Sé exactamente qué hacer. Aprendí fitoterapia durante mis años de viaje. Recojamos algunas hierbas y cultivemos un <color=#f58c26>Jardín de hierbas</color> aquí, como mi forma de pedir perdón."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"¡Gracias! Es muy amable por tu parte. ¡También regresaremos a casa más tarde para liberar a quienes están atrapados en tótems ahora que hemos aprendido cómo! Genial, ¡vamos!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>¡Hemos vuelto, y hemos traído ayudantes de casa! ¡Construyamos el jardín entonces!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Vaya, no puedo decir que no estoy impresionado, se te da muy bien esto. Este pequeño jardín es hermoso. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>Y muy útil también. ¡Los trabajadores ahora están siendo curados y pronto estarán listos para reconstruir el puente!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Encantado de poder ayudar."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"Hablando de eso, de hecho, la Sacerdotisa aquí presente solo estaba diciendo lo virtuoso y conocedor que eres. Lo que intento decir es…"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Sería un honor si un aventurero experimentado y una gran figura como tú pudiera unirse a nosotros. ¡Pero eres una leyenda! ¡De ninguna manera te unirás a unos extraños! ¿Podrías? ¿Por favor? ¡¡¡Ven con nosotros!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Por supuesto. Quizás es precisamente por eso que me envían aquí."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Lo sabía. Tú no……¿¡QUÉ?! ¡¿Vienes con nosotros?! Oh, no puedo creerlo... ¡El mejor día de mi VIDA! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Lo siento, a veces puede emocionarse demasiado. Entonces, ahora que te has unido a nosotros, ¿qué tal si organizamos una fiesta de bienvenida para ti?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"No, estoy bien sin una fiesta, tengo asuntos más urgentes que atender. Voy a buscar madera para reconstruir ese puente que rompí."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>¡Qué hombre tan honorable! ¡Oh! Tan solo conocerlo...... ¡El mejor día de mi VIDA!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>Eres el Jefe... ¿verdad? Gracias por tu ayuda allí atrás. Ahora estamos listos para reconstruir ese puente."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>¡Como nuevo! Ahora, ¿estás emocionada de volver a hablar con Dios, sacerdotisa Enda?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>¡Más listo que nunca! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Vale, Jefe, mientras la sacerdotisa disfruta de su reunión con su amado altar, podemos trabajar un poco..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Ay, ¿qué me ha hecho tropezar? Eh, ya veo, un trozo de <color=#38c0a5>Mineral Salvaje</color> del <color=#f58c26>Altar</color>. Sois realmente descuidados cuando trabajáis."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>¡Ajá, lo sé! Necesitamos construir un <color=#f58c26>Almacén</color> para almacenar recursos, de modo que la gente no se tropiece con los materiales que se encuentran por todos lados."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>¿Tienes todo lo que necesitamos? ¡Entonces comencemos la fiesta! Lo siento, quiero decir el <color=#f58c26>Almacén</color>."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Muro firme, espacio bonito y grande... ¡Excelentes habilidades de construcción, Jefe!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Eh…… ¿Señor? Hay una cosita de ocho patas justo detrás de ti."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"¡¿Qué?! ¡¿Cómo?! ¡¿Qué es ésto?! Parece el cuerpo de una especie de criatura que habita en el agua... hmm, ¡y la piel es viscosa y elástica!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>¡Kraken</color>! ¡Es un <color=#f58c26>Kraken</color>! ¡He leído sobre ellos en mis libros! ¡Debe ser un bebé de ese monstruo! ¡¿Por qué hay un <color=#f58c26>Kraken</color>?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"No hay necesidad de entrar en pánico. Por un lado, está realmente muerto, y por otro lado, es solo un <color=#f58c26>Pulpo</color> común varado."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>¿Pulpo? Nunca había escuchado sobre ellos..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Eso significa que debéis ser del interior, eh. Mi gente es nómada. Dependemos del mar. Para nosotros, los pulpos son tan comunes como las estrellas en el cielo nocturno."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"De hecho, ven conmigo, busquemos cuerdas y ramas. Te mostraré cómo construir una tienda de campaña con piel de pulpo."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>……y ya... está. Se veía mucho mejor en mi imaginación."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>Es…eh…...eh…...¡adorable!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Lo siento. Soy más una persona teórica que práctica. La construcción no es mi fuerte. Ahora...... puede que necesite acostarme....."],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"¡Oh, gran Amergin! ¿Por qué no vas a descansar en la tienda principal? ¡Yo seré tu compañía! Me has impartido tu sabiduría y estaré para siempre a tu servicio."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Este debe ser un sueño de la infancia hecho realidad para una sacerdotisa. Me alegra ver que esos dos se llevan bien. Sin embargo, todo parece un poco extraño, ¿no crees, jefe?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Los ancianos dijeron que aquellos que viajaron al mar nunca habían regresado, excepto aquel que regresó como un loco, hablando de una barrera gigante hecha de agua en el borde del mundo."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>¡Sin embargo, ese Amergin dijo que son gente del mar! ¡Nadie vive en el mar!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>Por eso es curioso. Pero de todos modos, no nos ha hecho ningún daño. Sigamos con nuestros trabajos actuales por ahora. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Ahora que has explorado la zona, la cantidad de trofeos que hemos encontrado es considerable. El ganado puede ayudar a traerlos a casa y, para su conveniencia, debemos construirles un<color=#f58c26>Establo</color>."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>¡Te ves bien, Jefe! Parece que estos pequeños serán útiles de inmediato, ¡fantástico!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>Casi hemos terminado con las construcciones, aunque hay una última cosa con la que necesito tu ayuda."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>En caso de que algunos malintencionados arruinen nuestro campamento una vez que nos hayamos ido, necesitamos un equipo de exploradores profesionales para patrullar el área y proteger nuestro trabajo aquí."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>¡Necesitaremos un <color=#f58c26>Círculo de Entrenamiento</color>!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Eso es, Kevin, un <color=#f58c26>Círculo de Entrenamiento</color>. ¡Busquemos algunos materiales!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>¿Estás listo?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>¡Sí, señor!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>El jefe ha terminado de preparar los materiales, ¡comencemos!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>¡Sí, señor! ¡No hay problema señor!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>¡Buen trabajo! Y ahora... ¿Sacerdotisa? ¿Qué ocurre?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Estaba hablando con el Archidruida Amergin, luego los dos nos quedamos dormidos debido al agotamiento, y ambos tuvimos ese extraño sueño en el que una diosa nos decía “Salva el <color=#f58c26>Corazón del Mar</color>…...”"],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%>¿<color=#f58c26>Corazón del Mar?</color>? ¿Qué es eso?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"Tenemos un viejo cuento sobre una burbuja gigante en el mar, protegida por la más joven de las Diosas. En ella no solo sobrevivieron animales antiguos, sino que aún viven gigantes y hadas. Pero es simplemente un cuento para antes de dormir."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Debo llegar al fondo de esto. Para recibir un mensaje más claro de la Diosa, necesitaré una <color=#f58c26>Base de Runas Podesora</color>."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Recibido. Vale, Jefe, vayamos a buscar algunos minerales salvajes y construyamos esa base para Enda."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>¡Ya casi hemos terminado! ¡Debemos celebrarlo!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>¡Hurra!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>¡No celebres todavía! ¡No puedo concentrarme cuando estás tan clamoroso!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>¡Estaba tratando de reconectarme con Dios y he fallado por culpa vuestra, idiotas alborotadores!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>¡Cerrad la boca y dejadme en paz!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Ouch, parece que alguien no está teniendo un gran día."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>¡Espera! ¡Silencio! Creo que puedo oírla. Esto es muy importante."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Hmm... no puedo escuchar con mucha claridad... pero lo que supongo es que... deberíamos ir hacia el norte, donde nada puede crecer y nada puede vivir. Allí encontraremos una amiga."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Está bien, suena...... ¿factible? Quiero decir, ¡qué puede pasar! ¡Vayamos al norte! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Pero antes de eso, ¡finalmente es la hora de celebrar nuestro nuevo campamento! ¡Reuníos, porque vamos a tener una gran fiesta!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>¡Hurra!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Salimos de casa pensando que tal vez nunca más volveremos, sin embargo, encontramos esta increíble isla, conocimos nuevos amigos e incluso encontramos formas de revivir a miembros de la tribu que pensábamos que se habían perdido para siempre."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"Por todo esto, tenemos que agradecer a nuestra diosa, que nos ha estado cuidando y guiándonos, a nuestro nuevo amigo, el querido Amergin, que nos ha prestado desinteresadamente sus increíbles conocimientos."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Pero lo más importante, Jefe, no podríamos haber logrado nada de esto si no te hubieras mantenido fuerte y amable. Así que gracias Jefe, por todo lo que has hecho por nosotros, y…… uh…… Sacerdotisa, ¿estás llorando?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Estoy… no estoy… *sollozar* llorando…… es solo…… *sollozar* ¡Vale, lo estoy! ¡Estoy llorando! ¡¿Estáis satisfechos?! ¡Te quiero Jefe! ¡¡Eres el mejor Jefe!! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Jaja, creo que eso lo dice todo, Jefe. No puedo esperar a ver cómo será nuestro viaje más adelante, y un día, definitivamente resolveremos el misterio de nuestro hogar y lo reconstruiremos."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>No os apresuréis chicos, ya casi llegamos..."],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>¡Dios bendiga! Hemos estado caminando por el desierto durante días, ¿tal vez me puedas dar un poco de agua? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>¡Ten paciencia! Cuando yo tenía tu edad……. Oye, ¿qué es esto?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>¡WOAAAAAAH!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>¡¿Sacerdotisa?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Oh no, ¿estás ahí abajo mi sacerdotisa? ¿Estás bien?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Bueno... todavía estoy vivo... Hmm, creo que fui arrastrado por esta... ¿mina mágica?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Oh, gracias a Dios, estás bien, no te preocupes, haremos todo lo posible para sacarte de allí lo antes posible."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Jefe, encontré un edificio abandonado en la cima de una colina cercana. Pude ver una gran máquina de cuerdas de paja dentro, pero está rodeada de un desastre espantoso."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Supongo que es un <color=#f58c26>Taller Antiguo</color> de algún tipo."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Podemos intentar abrir la puerta y limpiarlo para hacer una polea de cuerda y sacar a la sacerdotisa."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>¡Bueno, deja de parlotear y ve a hacer esa polea!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"¡Cálmate sacerdotisa! El cielo se está oscureciendo, ¡pronto hará mucho frío aquí! Por lo tanto, primero debemos encontrar materiales para construir una <color=#f58c26>Tienda de Campaña</color> y tratar de resolver esto después de que todos hayan descansado un poco."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>¡¿Pero qué hay de mí?! ¡Podría morir congelada!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>No te preocupes, aunque la diferencia de temperatura sobre el suelo entre el día y la noche es enorme, la temperatura bajo tierra es siempre constante y agradable. ¡Aguanta, sacerdotisa! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"Al día siguiente..."],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>¡Qué bien he dormido esta noche! ¿Cómo estás ahí abajo, mi sacerdotisa?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>¡Te agradecería que gastaras tu energía en sacarme de aquí en lugar de preguntarme cómo estoy!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>Estamos trabajando en ello, solo necesito algunas herramientas necesarias para abrir esa puerta antes de continuar. Por favor, mantén la calma. *Sonríe*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Espera a que salga de aquí... Mocoso ingrato e irrespetuoso..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>¡Ay, has herido mis sentimientos! ¿Cómo malinterpretas mi buen corazón de esa manera? Pero te perdono. ¡El jefe y yo volveremos de inmediato!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Vale, ¡estamos dentro! Ahora solo necesitamos..."],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Señor, ¡cuidado! ¡detrás de ti!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"¡Ay! ¡¿De dónde vino esta flecha?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"¡Sal del edificio!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"¿Quién está ahí?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"¡Sal! ¡Secuestrador!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"¿Secuestrador? Creo que tienes a la persona equivocada, señora voz... ¡Ay, ay, ay!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Señora voz, hemos salido del edificio, ¿podrías explicarme ahora qué está pasando?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"En primer lugar, mi nombre no es señora voz, soy Tlachtga, cazadora de relámpagos, hija de Mug Ruith, madre de toda la tierra, heroína de..."],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>¡¡¡Gran Tlachtga!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"¿Qué...... De dónde salió esa voz...... del pie de la colina? ¿Alguien cayó en esa mina?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Vosotros tres, quedaos perfectamente quietos hasta que regrese. Si descubro que os habéis movido tan solo un centímetro, sabéis lo que va a pasar."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"¡Sí, señora, ni un centímetro!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"Ahí estás. ¿Una sacerdotisa? ¿Qué haces ahí abajo? Rompí la entrada de esta mina mientras buscaba a alguien, ¿cómo es que estás en ella?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Para resumir, estaba con los tres chicos que atrapaste allí, pero caí en esta mina. Pero eso no es importante. ¡Estás aquí! Predije que encontraremos a una amiga que nos puede ayudar en esta tierra estéril, ¡no puedo creer que seas tú!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>¿Amiga? ¿Ayudarte? ¿Para qué? Vosotros... ¿no sois secuestradores?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>¿Secuestradores? No, no, no, ¡solo somos transeúntes, en una búsqueda para encontrar ayudantes para salvar nuestro hogar! *Explica*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Eh. Ahora que lo has dicho, mamá dijo acerca de conocer a un grupo de personas como tú… pero luego ella desapareció… Eso significa que me equivoqué de gente."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>¿Mamá?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Olvídate de eso, no es gran cosa. ¿Supongo que tus chicos se metieron en esa trampa mía tratando de poner en marcha esa máquina de cuerda, para así poder pescarte?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Sí, sabia señora, eso es exactamente por qué, y cómo terminé estando así, con un solo pie."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Dios mío, culpa mía, te ayudaré con tu herida más tarde. Ahora mismo déjame quitar mis trampas y arreglar esa máquina de cuerda para ti..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>La máquina de cuerda de paja está en funcionamiento, ¡excelente trabajo, señora!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>¡No es excelente en absoluto! ¡Levántame! ¡Ahora mismo, de inmediato!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Solo queda un paso. Solo tenemos que preparar la cuerda de paja y la polea antes de que podamos pescarlo."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>Siento que me estás apuntando...*Lágrimas en los ojos*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Mi jefe, ¿ya terminaste de recolectar los materiales? Está bien que te tomes tu tiempo, porque ya que Enda no está aquí, finalmente podemos tener algo de paz por aquí..."],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>¡Todavía puedo oírte! ¡Eso no está bien!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>¡Ups! No sabía que podía oír... ¡Ajá, la polea está lista!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Querida sacerdotisa, el equipo de rescate está abajo, por favor hazte visible para que no te pisen..."],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>¡Estás encima de mí! ¡Fuera de mí! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>Parece que la sacerdotisa saldrá pronto, muchas gracias, señora."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>No me llames señora, mi nombre es Tlachtga. Bien, déjame ver, ¿dónde te he lastimado?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>Me diste en la espinilla, señora, digo... Tlachtga."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Entendido. Las cazadoras como yo somos profesionales en el cuidado de heridas. Tengo una bolsa de Hojas Suculentas en la mina. La usé como almacenamiento. ¡Cultivemos algunas de ellas y frotemos ese jugo en tu linda patita!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Eh... patita... está bien. ¿Entonces deberíamos ir allí ahora? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"No, no, no, pequeños debiluchos, necesitaréis antorchas para ver allí abajo. Es mucho más profundo de lo que piensas. ¡Ve a buscar antorchas y herramientas de excavación!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Sujeta esto, si el fuego se apaga, detente y date la vuelta, ¿de acuerdo?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>¿Listo? ¡Vamos! ¡Cuida tus pasos!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>¡Sí, señora!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Jefe, gracias por quedarte aquí con la Sacerdotisa y yo. Estoy bastante triste por no poder ir, pero Tlachtga dijo que sería mejor que me quedara aquí si no quiero perder la pierna. ¡Sin embargo, no puedo esperar a ver lo que pueden traernos!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>No puedo creer que la Gran Tlachtga te haya dejado llamarla por su nombre. ¡Que honor! Y no muestras ni un poco de gratitud..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>¿Oh dios mío, qué es eso?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>¡Es un río subterráneo! ¡No puedo creer que nuestro equipo haya encontrado un <color=#f58c26>Río Subterráneo</color>! ¡Ahora tenemos agua!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>Y empapado."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>¡Bueno, endurécete, debilucho! ¡Es solo un poco de agua! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Oye, jefe, ahora que tienes agua, ¡podemos cultivar algunas suculentas! Una hoja de suculenta más algunos cánticos y el cuidado adecuado, ¡obtendrás una suculenta regordeta en poco tiempo!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Estas señoritas son todas tuyas, haz que busquen baldes, palas y fertilizante. Yo voy a esperar aquí."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>¡Bien! Listo, ¡mira qué bonito es! Toma un trozo, uno grande."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Nunca había visto este tipo de planta antes... ¿Qué? ¿Que tome un trozo dices?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Sí, toma una hoja, exprime su jugo, frótala sobre tu piel herida."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Bien... Toma un trozo... Frota... ¡Vaya, realmente ha funcionado! ¡Nunca había oído hablar de ninguna hierba que pudiera curar heridas tan rápido!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"La gente me llama madre de toda la tierra. Supongo que este apodo proviene de mi increíble pulgar verde. Estas no son suculentas normales. Las cultivé yo."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>¡Un hacedor de milagros! ¡Ah! ¡Ahora siento que podemos resolver el misterio de nuestra tierra natal en poco tiempo! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"En realidad, sobre eso, realmente necesito tomar una siesta ahora que estoy sin energía. ¿Te importa si voy a tomar una siesta en esa "Casa" tuya? ¿Es un Campamento Base? ¿Tienes una cama?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Sí, es como una especie de Campamento Base, y aquí está el mapa que hicimos para volver. Pero...... ¿estás pensando en hacer una pijamada o te unirás a nosotros?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>¡Por supuesto que me uno a ti! ¡¿Eres estúpido?! Necesitas ayuda, y yo no estoy haciendo nada, ¿por qué no? Probablemente estemos detrás de la misma persona de todos modos. ¡Entonces! Tomaré ese mapa, ¡nos vemos!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"Y se va. Tengo la sensación de que será una gran amiga para nuestra gente. Entonces terminemos de construir nuestro campamento. Al igual que nuestro antiguo campamento, necesitamos un <color=#f58c26>Almacén</color> para almacenar los materiales."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>¡Vamos a reunir algunos materiales para el <color=#f58c26>Almacén</color>!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>¡Buen trabajo! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>¡Aún no me has agradecido por llevarte al agua! ¡Te dije que tenía razón sobre este lugar!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Vale, vale. Respetaré completamente tu adivinación en el futuro y satisfaceré cada una de tus solicitudes irrazonables. Ahora, ¿qué necesitas a continuación?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>¡Tú...! No importa. Necesito volver a hablar con Dios para saber adónde debemos ir a continuación. Esta vez necesito una <color=#f58c26>Atalaya</color> para probar la Astrología. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>¿Por qué la Astrología? Ni siquiera estamos seguros de qué son esas estrellas, quiero decir, ¡son solo puntos brillantes en el cielo!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>¡No nos queda tiempo! ¡Tenemos mucho trabajo por hacer! ¡Detén tus estúpidas tonterías!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>¡Ve a buscar las cosas que necesitamos y regresa lo antes posible!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Está bien..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Los adultos me dijeron que no me metiera con los mayores, por qué nunca les escuché..."],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Vale mi jefe, ya has terminado tu trabajo, y lo único que queda es la <color=#f58c26>Atalaya</color> que la sacerdotisa me pidió que construyera..."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>¡Te escucho, idiota! ¡Deja de quejarte y haz tu trabajo!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Vale~vale~*Suspiros*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Vale jefe, voy a ir a hablar con los dioses."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Puedes relajarte por un segundo, nos vemos en un rato."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Susurros* Por aquí, jefe, por aquí..."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Enda finalmente puede detenerse por un momento."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>Nuestro equipo encontró un montón de oro y minerales salvajes en la mina."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Estamos pensando en hacer un cofre para transportarlos hasta aquí, por eso estamos aquí buscando tu ayuda."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>¿Te importaría recolectar algunos materiales para hacer ese cofre?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Guau, realmente es mucho oro. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>¿Qué es esto? Está brillando..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>Es un pequeño paquete... dice "cómeme". Y dentro hay, ¿una <color=#f58c26>Semilla Resplandeciente</color>? Eso significa tienes que... ¿comerte la semilla?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>¡Déjamelo a mí!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>¡¿Qué?! Sacerdotisa, ¿qué estás haciendo?"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>¡¿Te la acabas de comer?! ¡Aún no hemos descubierto qué es!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"El patrón de estrellas se alineó para apuntar al <color=#f58c26>Gran Cañón</color> al <color=#f58c26>Sureste</color>, y la <color=#f58c26>semilla sedante</color> me ayudará a encontrarme con el Gran... *ronca*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>¿Sacerdotisa? ¿Sacerdotisa? ¿Sigues ahí?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*Ronca*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>Y se quedó dormida. No puedo entender a estas personas con poderes misteriosos. Parecen tan extrañas a veces. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Ehhh, ¿a dónde deberíamos ir ahora que la sacerdotisa se ha desmayado?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>¿Dijo el <color=#f58c26>Gran Cañón</color> verdad? ¿Hacia el <color=#f58c26>Sudeste</color>?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>¿Deberíamos confiar en ella? Parece un poco... ¿como que no es ella misma en este momento?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Sí, le prometí que confiaría en ella en el futuro. Además, ¿adónde podemos ir ahora de todos modos? Descansemos por hoy, y dirijámonos mañana al sureste."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>¡Eh, tú!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"¿Yo?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"¡Sí! Tú. ¿Te importaría echar una mano a una anciana?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Ehh... realmente no estoy aquí."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"¿Eh, y eso por qué?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Estoy con la gente de mi tribu en este momento. Estamos en un viaje en busca de héroes que puedan ayudarnos a resolver el misterio de nuestro hogar."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Ya veo. De hecho, estoy hablando con tu alma, ¿a través de ese pequeño bloque brillante en tu mano?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"Mi……¿<color=#f58c26>teléfono</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Sí, exactamente. El <color=#f58c26>“mi teléfono”</color>. ¿Me ayudarías?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Espera...... ¿Por qué puedes *olerme*?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Oh cariño, aunque tengo un ojo ciego, todavía puedo percibir todo. Lo entenderás más tarde. Ahora, ¿me ayudarías?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Está bien. ¿Qué necesitas?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"Tu tribu va a pasar, ¿verdad? ¿Finjo que necesito comida desesperadamente y sostengo un <color=#f58c26>Puesto Pequeño</color> para vender mi basura? ¡Dios mío, maravilloso plan!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"No lo entiendo..."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"No quiero ayudar a ningún patán alreatorio, ¿verdad? Debes ser amable para merecer mi ayuda."],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"¿Entonces?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"Si compran mis cosas y me dan comida, está BIEN. O me dan comida directamente, ¡es incluso mejor!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"¿De lo contrario? Un chasquido de dedo y tu tribu dejará de existir. ¿Entiendo? ¡Así que ve a buscar algunos materiales para mí!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"¡Increíble! ¡Muchas gracias a todos! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"Espero que mi hija sea tan confiable y eficiente como tú. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Nos separamos antes en el desierto y yo me perdí...... Mi sentido de la orientación no es muy bueno. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"¿Sabes dónde está ahora?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"¡Por supuesto que sé dónde está! Pero ella no puede simplemente… ¡no buscarme! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"Esto sienta bien. ¿Sabes? Solos tú y yo, relajándonos, charlando un poco, derramando un poco de té..."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Están viniendo. Solo tenemos que esperar."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"Ha pasado mucho tiempo."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Voy a subirme a esos huesos y comprobar dónde están."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"¡Ja! ¡Están ahí! ¡Esa pequeña sacerdotisa tuya es irresistiblemente linda!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"Muy bien, estarán aquí en poco tiempo. ¡No puedo esperar a conocer a tu gente! Solo necesito bajar con cuidado......"],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"¿Estás bien?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"¿Hola?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Un momento después"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>"“Muero de hambre por favor compre cosas, dé comida por favor”. Eh. Parece que alguien ha empezado un pequeño negocio aquí."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Ah, Jefe, aquí está. La Sacerdotisa Enda dijo que alguien de su sueño nos está esperando aquí. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"Veo algunos rastros de actividad humana aquí, pero esta fogata se ha apagado, este pequeño puesto está a punto de romperse y no veo a nadie alrededor... ¿Nos han dejado plantados?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"De todos modos, construyamos un campamento y pasemos la noche aquí, y esperemos a que aparezca esa "persona del sueño"."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"Estoy tan agotada... por fin... ¡esta capa es un horno! ¡Estoy asándome! ¡¡Quítamela!!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Querida sacerdotisa, justo ahora estabas durmiendo profundamente sobre el lomo de un camello. No puedes decir que estás “agotada”."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"Por cierto, tampoco puedes quitarte la capa. Incluso si hace tanto calor como el Hades en este momento, todavía hace mucho frío por la noche."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Querido Dios... por qué me has pedido que vaya a este lugar desolado... y que aguante también a este joven arrogante..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"Por favor ten un poco más de paciencia. El jefe reunirá los materiales que necesitamos para construir una <color=#f58c26>Tienda de Campaña</color> aquí."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"¡Bien hecho Jefe! ¡Empecemos!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"¡Estupendo! Creo que la gente ya tiene hambre. Aprovechemos al máximo esta fogata y cocinemos algo. ¡Come bien, trabaja bien!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"¡Hurra! ¡Comida! ¡Beicon!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Chuleta de cordero para mí por favor..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"¡Salvajes carnívoros!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"¿Y tú qué quieres?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Bistec mediano con salsa de rábano picante por favor."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Sacerdotisa, eso también es..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"¡Lo sé! ¡Cállate!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Jaja, la proteína es muy importante para un cuerpo que viaja. Ha sido un viaje difícil, ¡así que festejemos! ¿Qué dices, Jefe?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"No tenemos tantos materiales para cocinar..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"¡Tenemos cordero, ternera seca y manzanas, Jefe!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Pero el Jefe tiene razón, todavía debemos guardar algo de comida para las noches más difíciles. Así que deberíamos encontrar algunas proteínas alternativas."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"Vi algunas lagartijas del desierto. ¡Los huevos de lagarto y ellos mismos serían una gran fuente de proteínas!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"¡¿Qué has dicho?! ¿Lagartijas? ¡¿Cómo podemos comer lagartijas?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"¡Hay todo tipo de manjares que podemos cocinar si abrimos nuestras mentes! Por ejemplo, "estofado de lagarto" suena particularmente atractivo."],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"¡No puedo esperar!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Oh...... cazar lagartos......"],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"¡Increíble! ¡Has reunido todos los materiales! ¡Pongámonos en marcha!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"¡Vamos! ¡Enciende la fogata!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Por fin... Comida... No puedo moverme más... Huevos Fritos... Filete... Manzana horneada..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Chuleta de cordero para Arlan, huevo frito para Kevin... Y la sacerdotisa Enda compartirá este plato de delicioso estofado de lagarto conmigo..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"¡Nadie va a compartir el estofado de lagarto!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"En ese caso, les daré este plato de guiso caliente, humeante y delicioso a nuestros nuevos amigos."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"¿Nuevos amigos? ¿Qué nuevos amigos?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"¡¡¡Ah!!! ¡¡¡Noooo!!! ¡Quítame estas ratas!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"Son demasiado grandes para ser ratas. Según mi observación, son Maubbits, una especie de roedores exclusivos de las regiones áridas."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"Suelen ser sorprendentemente tímidos teniendo en cuenta su impresionante tamaño, lo que los hace completamente inofensivos para los seres humanos."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"¡Vale, vale, lo sé! ¡No me importa lo que sean! ¡Quítamelas de encima!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Ahora que lo has mencionado, es bastante extraño que no te tengan miedo en absoluto..."],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Queridos trabajadores, ¿seríais tan amables de alejar estas hermosas criaturas de nuestra sacerdotisa?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"¡Sí!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"¡Oye! ¡Devuélvemelo!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Hmm, y se van. Parece que todavía le tienen miedo a todos menos a la sacerdotisa."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"¡Se llevaron mi anillo! Mi querido anillo..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Pobre sacerdotisa, supongo que podemos seguir sus pasos hacia los restos del dragón. De todos modos, tengo bastante curiosidad por esos pequeños. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"Y para hacer eso, necesitamos un <color=#f58c26>Molino de Viento</color> que nos ayude a transportar personas hacia arriba y hacia abajo considerando lo empinada que es la montaña."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"¡¿Ya están listos los materiales para el <color=#f58c26>Molino de Viento</color>?! ¡Impresionante!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"¡Se viene un Molino de Viento fresco!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"¡Genial! ¡Ahora es mucho más seguro y conveniente subir y bajar la pendiente!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"¡Estupendo! ¡Date prisa y trae mi anillo! ¡Esa cosa es sagrada!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"¡Vale, vale, allá vamos! Kevin, Arlan, ¿estáis listos?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"¡Listos, como siempre!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Eh…… señor…… no es que sea un cobarde, pero creo que necesitaríamos unas cuerdas en caso de que nos caigamos del acantilado……"],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"¡Ajá, tienes toda la razón! ¡La seguridad en el trabajo es importante! ¡Jefe, busca el equipo de seguridad!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"¿Estamos listos ya?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"¡Sí!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"¡Estupendo! ¡Vamos a resolver el misterio de Maubbits ahora mismo! ¡Qué emocionante!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"¡Y recupera mi anillo!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"¡Vaya, este montón de huesos es realmente profundo! Espera... hay una cosa brillante en la parte inferior... Hmm... ¿Puede ser el anillo de Enda?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"¡Jefe! ¡Mira lo que hemos encontrado! ¡Una anciana cubierta en la tierra!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"Y el anillo de la Sacerdotisa."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Lágrimas en los ojos* Gracias, Arlan, el más sensato de todos nosotros…... Espera…… ¿qué?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Ruidos de emoción*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"Supongo que…… ¿gracias?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Ruidos de felicidad*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Ruidos de emoción*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"¡Oh, hey! ¡Hola! ¡Eres tan amable! ¿Nos conocemos? Tu pelaje me parece bastante familiar..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"¡Oh! ¡Y tú debes ser esa pequeña sacerdotisa en mi sueño! ¡Incluso eres más bonita en la vida real!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"¿Pequeña? ¡¿Cómo te atreves a llamarme pequeña?! Soy la noble mensajera de Dios..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Perdona, ¿dijiste que soñaste con nuestra sacerdotisa?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"¡Oh ~ joven! ¡Sí! Soñé con decirle a tu pequeña sacerdotisa: “Te estaré esperando”. ¡Pero no sé qué significa eso en absoluto!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"¡¿Qué quieres decir con que no sabes lo que eso significa?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"De hecho, es gracioso. No recuerdo mi nombre en absoluto, así que no sé qué significa ese extraño sueño. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"Debo haberme golpeado la cabeza con bastante fuerza mientras caía al pozo. Todavía me tambaleo un poco cuando camino. "],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"¿Es tuyo este pequeño puesto? Dice “Muero de hambre, por favor compre mis cosas, dé comida, por favor”."],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"Dado que lo que está escrito en este puesto me describe con precisión, y que estamos en medio de un desierto, sí, supongo que es mío."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"¡Oh! ¡No te preocupes! Tenemos comida. Ven a disfrutarla en nuestra tienda de campaña."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"¡Eso sería estupendo!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"Oh, pero una cosa, huelo tocino, manzana horneada, y……<color=#f58c26>una tormenta inminente</color> en el aire. Será mejor que estéis preparados. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"Y... se va. Muy bien, Jefe, estoy seguro de que lo has escuchado, el viento es muy fuerte y loco por aquí, déjame ver..."],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"Nuestra carpa necesita algo de refuerzo en la parte superior para cargarla bien de peso."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"¡Por qué tenemos que escucharla! Ni siquiera sabemos de dónde es, ¡y crees en lo que dice! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"Mis predicciones... ¡siempre encuentras un error y te ríes de mí una y otra vez! Descubriré las verdaderas intenciones de esta mujer. ¡Espera y verás!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"Ooooh, alguien se está volviendo competitivo. De todos modos, Jefe, hice la lista de los materiales necesarios para <color=#f58c26>reforzar la tienda de campaña</color>, por favor echa un vistazo."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Hmm, buen té."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"Y esta galleta también está bastante rica, se te deshace en la boca. Aunque está un poco quemada por fuera. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"Puedes bajar la temperatura la próxima vez y cocinarlo por más tiempo."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"¡¿Por qué está tomando el té de la tarde?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"¿Qué pasa?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"¡Y qué pasa con ese extraño acento británico! ¡Ni siquiera estamos en la época adecuada!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Relájate, pequeña sacerdotisa. Todo irá bien. Lo entenderás."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"¡No! ¡Nada va a estar bien! ¡Y no voy a entender nada! Querido Dios… ¿De dónde diablos vino esta mujer……?"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Ya que lo has preguntado con la mayor sinceridad, de hecho, gracias al té de la tarde que acabo de disfrutar ahora..."],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Creo que he recuperado algunos de mis recuerdos. Quiero decir, hablando honestamente, hablando con franqueza, el hecho es..."],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"¡Escúpelo ya!"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"¿Puedes también reforzar ese <color=#f58c26>Puesto Diminuto</color> de fuera para mí?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"¡¿Qué?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Esta vieja larguirucha quien ha caminado durante días sola, construyendo este puesto mientras se muere de hambre... ¡Oh, qué pobre mujer!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Será devastador para mí si el puesto se rompe. ¡Mi destino está sobre tus hombros! ¡Estoy inmensamente agradecida!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Qué señora tan interesante."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"¡¿Perdona, qué has dicho?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Jefe, he hecho la lista de materiales para ti, por favor échales un vistazo."],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"¡¡¡No me ignores!!! ¡Vaya, no puedo soportarlo más!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"¡Estupendo! ¡Sois todos increíbles!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"¡Mamá! ¡Lo sabía! ¡Sabía que eras tú!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"¡Gran Tlachtga!, ¡¿cómo es que estás aquí?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"¿Y esta jovencita es?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"¡Tlachtga! ¡Tu hija! ¡Deja de hacerte la tonta! "],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"El mensajero me dijo que sacaron a una anciana ciega de un montón de huesos, se parecía mucho a ti, así que vine a comprobarlo."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"No estoy sorprendida de verte por aquí en absoluto."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"La madre de Tlachtga... Nunca escuché que Tlachtga tuviera madre..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"¡Por supuesto que tengo madre, idiota!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Vigila tu lenguaje."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Lo que sea, esta loca de aquí es Mug Ruith, que está de pie frente a ti."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Llámame Meg."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"Pero pensaba que Mug Ruith era un hombre..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"Bueno, mi madre puede ser muchas cosas en los cuentos. Ella ocultó su verdadera identidad a la gente cuando era pequeña."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Porque sabes, ¿quién es más probable que se aproveche de una mujer ciega y una niña de tres años?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Supongo que así fue como empezó a extenderse la historia... un druida omnipotente que lo sabe todo, un guerrero ciego, un poderoso caballero..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"Aunque en realidad es una anciana ciega con un extraño sentido del humor."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith es una mujer... he sido grosera con Mug Ruith... Oh... estaré condenada... Soy una desgracia para el título de sacerdotisa..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Pequeña sacerdotisa, no estés tan triste. Mejorarás siendo amable~ ¡Te perdono esta vez porque eres muy linda!~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"¿Entonces nos engañaste? ¿No perdiste la memoria?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Sí... lo siento por eso. Los viajes largos pueden ser aburridos, ¿sabes? Solo estaba divirtiéndome~ "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Pero bueno, ¡mira esa hermosa tienda de campaña y ese hermoso puesto! ¡Ahora esto está empezando a parecer un campamento! Aunque, todavía se siente un poco deficiente..."],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"¿Qué falta?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Déjame ver..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"¡Una puerta! Necesitas una puerta para marcar la entrada del campamento, y con algunas luces, ¡se verá más fabuloso que nunca!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"¡Seremos tus sirvientes más humildes e iremos a construir esa puerta, señora! ¡Jefe, recupérate!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"¿Todo listo? ¡Estupendo! ¡Adelante, adelante!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"¡Oh! ¡Qué rejuvenecedor! Este es el primer proyecto de construcción que he dirigido..."],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Enhorabuena, sacerdotisa, has crecido mucho. ¿Pero sabes si Meg está satisfecha con el aspecto de nuestro campamento ahora?"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Todo lo demás está bien, pero el cielo vacío parece bastante aburrido..."],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"¡Lo sé! ¡Lo sé! ¡Tenemos algunos globos de señales que pueden flotar en el cielo!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"¡Qué idea tan maravillosa! Solo que necesitamos algunos pequeños ajustes para darle vida. "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"¿Todavía tenemos esas brillantes rocas amarillas y rosadas?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"¡Sí, las tenemos!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Genial. Dame un momento. Kevin, ven."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Uff, eso ha sido bastante ejercicio. Pero míralos, ¿no son verdaderamente hermosos?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Sí, desde luego que lo son."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Me alegro de que te guste. Es raro cuando mamá hace algo normal. De todos modos, se está haciendo tarde, voy a regresar ahora. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"¿Ya te vas?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Sí, ¿o qué? ¡No voy a acurrucarme con vosotros, hombres malolientes, en esas pequeñas tiendas vuestras! Mamá, ¿vienes conmigo?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Te alcanzaré más tarde. ¡Tus nuevos amigos parecen encantadores, especialmente esta linda y pequeña sacerdotisa~! Quiero pasar un momento con ellos~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Mamá, contrólate."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Lo sé, lo sé, estoy bien controlada. Después de todo, todavía tenemos un largo viaje juntos esperando por delante."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Bien entonces. Nos vemos."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"¿Estabas sugiriendo que te unirás a nosotros ahora mismo?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"¡Por supuesto, por qué no! Vuestra aventura será cada vez más peligrosa. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"No hay mucho que pueda hacer, pero al menos puedo arrojar algo de luz sobre lo que está por venir."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Pero necesito que me muestres el camino a tu Tierra Natal. Mi sentido de la orientación es... inimaginablemente terrible."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Ouch... ¿Por qué existe un lugar así en la tierra? Siento que mis pies pisan llamas sin parar..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"¡Impresionante, Enda! Suspiro... No has hablado más de cinco palabras desde hace cuatro horas."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Estoy... demasiado cansado... demasiado caliente..."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"¡Montón de frágiles muñecos! Es simplemente un volcán. ¡Mirad vuestras posturas como si fuerais a tumbaros en el suelo!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Señora... Usted también ha estado sudando como un arroyo. ¿Está usted bien?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"¡Llámame Tlachtga!... No estoy cansada, pero sí hace mucho calor aquí... lo cual es mucho más peligroso que estar en el mar."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"Parece que hemos llegado."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"¡Déjame ver! Según las instrucciones de la Diosa, hay un mar en llamas con islas en él..."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"¡Sí, debe estar aquí!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"¿Pero dónde está Amergin? Amergin debería haber llegado y esperarnos aquí. Pero no se le ve por ninguna parte."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Debería construir un altar para sentir las huellas de Amergin. Pero..."],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"Oh... Jefe, yo..."],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"¡Enda!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"¡Enda!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"¡Debe haber sufrido un golpe de calor! ¡Deprisa! ¡Construye una sombra para que descanse!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"¡Señor, la construcción está terminada!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Diosa, parece ser que puedo vivir un poco más..."],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"En efecto, ¡hace demasiado calor! Echo tanto de menos el olor del mar..."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Uf, nuestro cura tiene mucho mejor aspecto."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"Es un poco mejor tener una carpa que nos proteja del aire caliente abrumador..."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Pero sólo un poco."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"¡Santa diosa! Por favor, dame la vuelta para que me puedan asar uniformemente..."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"Tengo que admitir que aquí se siente como una gran estufa."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"¡Mira! ¡Las tierras bajas de allí!"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"¡Contemplad, chicos! Mi madre literalmente dio a luz a un genio."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"¡Impresionante Tlachtga! ¡Eso es agua! ¡¡AGUA!!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Ja, pensé que nuestro piadoso sacerdote vio a la Diosa."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"He vuelto a la vida, ¡y me siento bastante bien!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"Veo que, en efecto, ¡estáis más enérgicos!"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"En este caso... tú, tú y tú, ¡daos prisa e id a construir una Anillo de Entrenamiento!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"¿Anillo de Entrenamiento?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Sí, ¡correcto!"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"¿No deberíamos estar buscando a Amergin?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin... ese viejo. Sé que puede controlar las fuerzas de la naturaleza como si fuera pan comido."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"En cuanto a vosotros, caminar hasta aquí os ha costado literalmente la mitad de vuestras vidas. ¿Cómo podemos dejar atrás el entrenamiento físico?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"Bueno, Enda necesita más ejercicio."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"¡Cállate!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"Según la profecía de mi madre, sólo nos esperan tormentas más fuertes..."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"La profecía de Mug Ruith..."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"¡Jóvenes!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"¡Entendido!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"¡Mira las tierras altas del norte! En realidad hay una escalera natural."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"¡Sí, señor!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"¿Te has fijado en la columna del centro? Eso no puede ser natural. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"Con tal altura y forma... ¡Apuesto por la reputación de mi familia de sacerdotes que debió ser un altar en los viejos tiempos!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"Este altar parece desolado."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Cierto, debe ser muy antiguo."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Un altar así, incapaz de resonar con el poder del Archidruida, no podría ayudarnos a encontrar a Amergin."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Jefe, necesitamos un dispositivo que pueda condensar la energía..."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"Los materiales deben ser capaces de resistir la alta temperatura, y la forma debe ser hacia adentro."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"¿Qué tal esos extraños colmillos cerca de la lava?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"¡No está mal, Arlan! ¡No es de extrañar que el consejo de despedida de la Diosa dijera que "siempre hay que estar cerca de los socios importantes"!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"¡Ciertamente! ¡Gracias a la Diosa!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"¡Cállate! ¡No estás incluido!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"¡Dejemos todos los materiales a nuestro maravilloso jefe!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Jefe, estamos haciendo muchos progresos."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"¡El altar debería estar bien para usarlo!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"¡Pero mira qué cielo tan sombrío! Enda ha estado luchando por subir y bajar las escaleras del altar. ¿Y si se cae?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"No está mal… Resulta que a veces no eres tan molesto."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"Después de todo, Enda es está mayor... Ummm... Quiero decir que ya no es joven."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"¿Por qué siempre tienes que cabrearme?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Construyamos antorchas a ambos lados de la escalera. ¡Es muy sencillo!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"Siento que a este altar... todavía le falta algo, porque no puede sentir a la Diosa en absoluto..."],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"¡Pero debería ser suficiente para percibir a Amergin!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"Hace frío... argh... ¿Quién está ahí?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"¡Amergin! ¿Dónde estás?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"¿Eres... eres Enda? No tengo ni idea de dónde estoy... Pero hace tanto frío aquí..."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"¿Frío?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"Parece que no está aquí."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"No puedo moverme... Ayuda, $#^*,!@%&:""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"¿Qué has dicho?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Oye, Enda. Creo que…"],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"¡Amergin! ¡Aguanta! Tengo que hablar con otra persona ahora, puede que te ayude."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, ¿has visto esta situación antes?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Oye…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"La comunicación espiritual no es realmente mi especialidad. Pero mi madre se ha encontrado con la misma situación. El problema debe seguir siendo el altar."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"El poder del altar es todavía demasiado débil. Falta lo más importante."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"El poder de la Diosa... @#$>:%^Esencia"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Jefe, creo que lo tengo. ¡Mira la vacante en la parte superior de la columna del altar!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Necesitamos llenar la Esencia Espiritual y aumentar el poder del altar. ¿Lo tenemos?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"¿Qué dices? Arlan, te lo entregaré enseguida."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"¡Lo tengo!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"¡Amergin, di algo!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Tienes que venir a buscarme..."],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"Debería estar bien esta vez. Tu voz por fin no suena ambigua como la de Meg que tose falsamente."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg es sólo una anciana."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Como has dicho..."],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"Había llegado al volcán una vez, pero no tenía ni idea de lo que había pasado después. Cuando me desperté, ya había acabado aquí, sea lo que sea este infierno."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Aunque tu altar puede llegar hasta mí, supongo que no podría llevarte hasta donde estoy..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Porque a pesar de que puedo sentir y responder a Enda, pero este lugar... definitivamente no, y se las arreglará para esconderse."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"¿Alguna idea?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Convivir con el entorno... sin parar... y formar una circulación."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"¿Qué quieres decir? ¿Dejar que las llamas de aquí fluyan hacia la bodega de hielo en la que estás?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"¡Estudiante cabeza de chorlito! Por supuesto que no."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Circulación... Que la lava fluya para crear cenizas, que las cenizas suban y se solidifiquen hasta convertirse en rocas y, finalmente, que las rocas vuelvan a erupcionar hasta convertirse en lava."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"Eres sin duda un alumno aventajado."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"¡Espera!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"¿Esto es... una cabeza de cerdo?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Ajá."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"Con todo el respeto, ¿por qué tiene forma de cabeza de cerdo?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Espera, no debería hacer esta pregunta."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"¡Diosa! Se necesitan socios queridos en el camino hacia el éxito. ¡Por qué no dejamos que mi compañero se quede aquí!"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"¡Mira qué lindo es nuestro sacerdote! Mira qué manera tan sutil de ser amable. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"¡Tú!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Quítate de en medio, el jefe y yo estamos a punto de empezar el altar."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"Suspiro... Enda, hora del espectáculo."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin está en..."],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"El Lejano Oriente... Un lugar helado y prohibido."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Aunque aquí hace mucho calor, creo que deberíamos empezar a preparar la ropa de invierno."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
